import RSVPform from '../components/Main/RsvpForm';
import RsvpAdmin from '../components/Main/RsvpAdmin';
import React from 'react';

class RSVP extends React.Component {

    render() {
        return (
            < div className="rsvp" >
                {
                    this.props.name === "admin" ?
                        <RsvpAdmin />
                        :
                        <RSVPform
                            name={this.props.name}
                            rsvp={this.props.rsvp}
                            email={this.props.email}
                            openRsvp={this.props.openRsvp}
                            openForm={this.props.openForm}
                            response={this.props.response} />
                }
            </div >
        );
    }
}

export default RSVP;
